import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'
import axios from 'axios'
function Detail() {
const {id}=useParams();

useEffect(()=>{
  axios.get(`http://localhost:8000/${id}`)
  .then(res=>console.log(res))
},[])
  return (
    <div>
      <h1>{id}</h1>
    </div>
  )
}

export default Detail
